import React, { useState, useEffect } from "react";
import api from "./Api";

const method = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    // // get query
    api.get(`/todo`).then(res => setData(res.data));
  }, [data]);
  return (get = () => {
    api.get(`/todo`).then(res => setData(res.data));
  });
};

export default method;
